          <br />
          <br />
          <br />
          <br />

          main
        </div>

        {/*Footer content*/}
        <div className={gridLayout.footerArea}>
          Footer
        </div>
      </div>

      <Router>

      </Router>

    </div>
  );
}

export default App;
